JOIN `customer` ON `customer`.`customer_id`=`return_info`.`sup_cus_id`
JOIN `stock` ON `stock`.`invoice_id`=`return_info`.`id`
JOIN `product` ON `product`.`product_id`=`stock`.`product_id`
