JOIN `admin` ON `admin`.`admin_id`=`return_info`.`insert_by`
WHERE `return_info`.`is_active` = 'Y'
AND `return_info`.`return_type` = '1'
AND `stock`.`form_id` = '6'
GROUP BY `return_info`.`id`
ORDER BY `return_info`.`id` DESC, `return_info`.`return_date` DESC
 LIMIT 10
